import {Button} from "react-bootstrap";

class Students extends React.Component {
  render() {
    return (
      <div>
        <h1>Students Page</h1>
        <Button variant="solid" >Tester Solid</Button>
        <Button variant="outline">Tester Outline</Button>
      </div>
    )
  }
}

export default Students;
